INSERT INTO `produto` VALUES (6,'Caixa de Som','Criado para os apaixonados por música e praticidade, a JBL GO transmite música via Bluetooth a partir de dispositivos móveis. É alimentado por uma bateria recarregável com até 5 horas de reprodução, e viva-voz com cancelamento de ruído, permitindo que voc','ELETRONICOS','JBL','GO','2017-08-22','2017-09-18'),(7,'Caixa de Som','O JBL Flip 4 é a última geração da premiada série Flip, uma caixa de som portátil com Bluetooth que oferece um som estéreo surpreendentemente poderoso. Esta caixa de som compacta é alimentada por uma bateria de íons de lítio recarregável de 3.000 mAh, que','ELETRONICOS','JBL','FLIP4','2017-08-22','2017-08-22'),(8,'Caixa de Som','A Caixa Bluetooth à prova d´agua Charge 3 agora vem com carregador portátil e deixa o som ainda mais potente. Escute suas músicas sem fios, por muito mais tempo e ainda leve sua festa para todo o lugar. Graças ao seu design à prova d´água, tecido durável ','ELETRONICOS','JBL','CHARGE3','2017-08-22','2017-08-22'),(9,'Perfume Masculino','O Perfume Ferrari Masculino possui aroma cítrico amadeirado, ideal para homens misteriosos e sensuais. Em sua fragrância, notas que combinam bergamota, maçã, ameixa, canela, jasmim, rosa, cedro e baunilha.','COSMETICOS','Ferrari','Black 125 ml (Eau de Toilette)','2017-08-22','2018-01-22'),(10,'Fone de Ouvido Wireless','Possui entrada auxiliar onde você pode ouvir musicas de celulares que não tem a tecnologia bluetooth. O fone de ouvido é carregado através da porta USB do seu computador ou carregador de 5v (não incluído). É possível receber e fazer chamadas pelo fone, se','ELETRONICOS','Ewtto','ET-A4260B','2017-08-22',NULL),(11,'Chromecast','O Chromecast é um dispositivo de streaming de mídia que é conectado à porta HDMI da sua TV. Use o dispositivo móvel e a TV que você já possui para transmitir seus programas de TV, filmes, músicas, esportes e jogos favoritos e muito mais. O Chromecast func','ELETRONICOS','Google','2','2017-08-22',NULL),(12